import React, { useState } from 'react';
import styled from 'styled-components';

const CardContainer = styled.div`
  background: red;
`;

function Card({id, type, wildCard}) {
  return (
    <CardContainer>{id}, {type}, {wildCard}</CardContainer>
  );
}

export default Card;
